import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Header from './Header/Header';
import Footer from './Footer/Footer';
// Временно закомментируем ShopPage для проверки
// import ShopPage from './Header/ShopPage/ShopPage';

// Тестовый компонент вместо ShopPage
function TestShop() {
  return <div><h1>TEST SHOP PAGE</h1></div>;
}

function HomePage() {
  return <div><h1>HOME PAGE</h1></div>;
}

function App() {
  return (
    <BrowserRouter>
      <div className="container">
        <Header />
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/shop" element={<TestShop />} />
        </Routes>
        <Footer />
      </div>
    </BrowserRouter>
  );
}

export default App;
